var tipuesearch = {"pages": [{'title': 'About', 'text': '\n 個人倉儲: https://github.com/40823217/cd2021 \n 二人小組(第九組):40823201/40823217 \n 小組倉儲: stage1-bg9 \n 四人小組(第十一組):40823217/40823201/40823209/40823210 \n 小組倉儲: stage2-bg11 \n \n \n \n \n CD2021 協同產品設計實習: \n 課程簡介: 從英文單字解釋了解何謂協同(Collaborative)? 產品(product)? 設計(design)? 以及實習(practice)? 然後讓各組在討論的過成中，使用網誌建立特定時間點的設計報告資料 \n cd2021 course repository: \xa0 https://github.com/mdecourse/cd2021 \n cd2021 course discussion: \xa0 https://github.com/mdecourse/cd2021/discussions \n cd2021 gitter:\xa0 https://gitter.im/mdecourse/cd2021 \n', 'tags': '', 'url': 'About.html'}, {'title': 'Stage1', 'text': '分組專題: \n W2-W4 (3 Weeks): 二人一組 \n W5-W9 (5 Weeks): 四人一組 \n W10-W18 (9 Weeks): 八人一組 \n', 'tags': '', 'url': 'Stage1.html'}, {'title': 'W1課程說明', 'text': '1.設計分析規劃簡報 (html) 與產品設計報告書 (pdf)協同設計方法與流程, 設計結果與自評 \n 2.每週分組報告必須包含 html, pdf 與 Youtube 影片 \n \n 【2021-協同產品設計實習-stage1-bg9】 \n 專題題目: 機車的空力套件 \n \xa0(適用車型為Yamaha-Force) \n 第一位組員:40823201 \n 第二位組員:40823217 \n (類型大致像於下面兩張照片的圈起處) \n \n 圖片截至於網路上 \n', 'tags': '', 'url': 'W1課程說明.html'}, {'title': 'W2~W4', 'text': '\n 題目:機車的空力套件 \n 動機: 想要騎車時少一點風阻 \n \n \n', 'tags': '', 'url': 'W2~W4.html'}, {'title': '原理介紹', 'text': '讓 行車過程中產生的氣流避開車底，增加行車的穩定性。 讓氣體順利通過車體，避免氣體產生過多的阻力阻礙車的動力。 藉由氣體的流動增加對車子本身的下壓力，增加輪胎與地面的抓地力。 雖然如此會對行車產生阻力，但是對輕量化的車款而言，這阻力的增加 是 對操控性非常有幫助的。 \n \n \n 樣本介紹源自於 《 Kawasaki 》開發的《 H2R 》， 那源自於航空領域的深厚流體技術便化做車身的銳利擾流翼，主要是藉由 切割氣流給予車頭更多下壓力道 ，維持高速下的車身穩定性，讓速度高達可怕的 300km/h 時速下。 \n \n \n ( 圖片來源：Kawasaki) \n (從這份專利圖面來看，左右葉子板的擾流翼配置並無太大的差異，主要的作動原理是藉由切割的氣流給予車頭更多的下壓力道，維持高速下的車身穩定性，固定用的鉚釘也特別施予航空等級的打磨加工，避免激烈震盪下的滑脫狀況。 然而，以碳纖維塑形的空力設計也絕非是設計團隊的隨興之作. \n \n \n (圖片來源：careta) \n 其內容源自於kingautos: https://www.kingautos.net/60678 \n', 'tags': '', 'url': '原理介紹.html'}, {'title': '設計概念', 'text': '\n \n 設計使用在機車上，鎖在前方後照鏡(紅色圈圈處)上的兩片風翼用來切開騎乘時所造成的風阻 \n 利用它將氣流導向兩旁，再利用機車本身的流線車形，讓氣流更快更順的通過車體 \n \n', 'tags': '', 'url': '設計概念.html'}, {'title': '成品介紹', 'text': '第一版 \n \n \n (還有一些地方需要去修改，例如:面風的那側不能這麼的平整， \n 這樣會不利於去切割氣流，還有背風面那側也要修改成較為平滑 \n 的斜面讓氣流去通過，讓車子增加一點的平穩度) \n \n 第二版 \n \n (導圓角剖面圖) \n \n \n \n 我們將面風處跟背風處都導上的圓角，讓氣流可以穩穩過 \n 然後在鎖點處挖了兩個孔，讓東西可以鎖在車上 \n', 'tags': '', 'url': '成品介紹.html'}, {'title': 'w4', 'text': '報告影片 \n \n', 'tags': '', 'url': 'w4.html'}, {'title': 'Stage2', 'text': '', 'tags': '', 'url': 'Stage2.html'}, {'title': 'w6討論主題', 'text': '主題:免彎腰販賣機 \n 繪圖:40823210、40823201 \n 網頁編輯:40823209、40823217 \n 模擬:40823217 \n 0331討論 \n \n', 'tags': '', 'url': 'w6討論主題.html'}, {'title': 'w7畫圖及找問題', 'text': '主題: 免彎腰販賣機 \n 動機:思考 到一些老人、行動不便者、受傷的人可能無法彎腰去拿取物品，所以我們將商品出口設置在右側中間。當我們買完商品時，商品即會掉落於斜面，且滾動至右側平台，而當平台偵測到重量，平台就會上升至出口處，購買者即可不必彎腰就可以拿去商品。 \n \n 畫圖的思路 \n', 'tags': '', 'url': 'w7畫圖及找問題.html'}, {'title': 'w8', 'text': '', 'tags': '', 'url': 'w8.html'}, {'title': 'w9', 'text': '', 'tags': '', 'url': 'w9.html'}, {'title': 'W5', 'text': '2b \n \n \n \n \n \n \n', 'tags': '', 'url': 'W5.html'}, {'title': '網站影片', 'text': '第一次所設計的樣式 \n 繪圖者:40823201 \n 使用AutoCAD2017/inventor2017繪製 \n \n 網址: https://youtu.be/kwgAzh8UZUM \n \n 這是第二版，針對外型上做些修正 \n \n 網址: https://youtu.be/D-XSP2ai4Gw \n w4報告影片 \n \n \n \n \n \n', 'tags': '', 'url': '網站影片.html'}, {'title': '筆記', 'text': '2020-2021的重要程式，跟做不對的地方 \n', 'tags': '', 'url': '筆記.html'}, {'title': '建立倉儲', 'text': '開啟9443 \n', 'tags': '', 'url': '建立倉儲.html'}, {'title': '使用ssh', 'text': '', 'tags': '', 'url': '使用ssh.html'}, {'title': '開啟leo', 'text': '', 'tags': '', 'url': '開啟leo.html'}, {'title': '改進', 'text': '\n \n \n \n \n \n', 'tags': '', 'url': '改進.html'}]};